import React from "react";
import { Container, Row, Jumbotron, Image } from "react-bootstrap";

const PortfolioHero = (props) => (
  <Jumbotron bg="dark" variant="dark">
      <h1>{props.Headline}</h1>
      <h5>{props.Subheader}</h5>
      <Image className="my-4" src={props.ImageLink} alt={props.ImageAlt} fluid />
      <h2>Overview</h2>
      <h5>{props.Overview}</h5>
  </Jumbotron>
);

export default PortfolioHero;
